                        },
                        ["init"] = {
                            ["custom"] = "-- Marks as used by Liquid\
              aura_env.defaultMarks = {\
                  {0, 8, 0, 7},\
                  {8, 7, 0, 0},\
                  {8, 0, 0, 0},\
                  \
                  {0, 8, 0, 7},\
