               if (GetTime() - (aura_env.castStart or 0) < 0.5) and UnitIsUnit(\"boss1target\", \"player\") then\
                   allstates[\"\"] = {\
                       show = true,\
                       changed = true,\
                       progressType = \"timed\",\
                       duration = 5,\
                       expirationTime = GetTime() + 5,\
                       autoHide = true\
                   }\
                   \
                   return true\
               end\
           elseif event == \"UNIT_SPELLCAST_START\" then\
               local _, castGUID, spellID = ...\
               \
               if not castGUID then return end\
               \
               if spellID == 467606 then -- Sound Cannon\
                   for _, state in pairs(allstates) do\
                       state.show = false\
                       state.changed = true\
                   end\
                   \
                   aura_env.castStart = GetTime()\
                   \
                   -- If the boss is already targeting us, create the state immediately\
                   if UnitIsUnit(\"boss1target\", \"player\") then\
                       allstates[\"\"] = {\
                           show = true,\
                           changed = true,\
                           progressType = \"timed\",\
                           duration = 5,\
                           expirationTime = GetTime() + 5,\
                           autoHide = true\
                       }\
                   end\
                   \
                   return true\
               end\
           end\
