           if event == \"OPTIONS\" then\
               for i = 1, 2 do\
                   allstates[i] = {\
                       show = true,\
                       changed = true,\
                       progressType = \"timed\",\
                       duration = 22,\
                       expirationTime = GetTime() + 22,\
                       autoHide = true\
                   }\
               end\
           elseif event == \"LIQUID_CUSTOM_EVENT\" then\
               local id = ...\
               \
               if id ~= aura_env.id then return end\
               \
               local count = WA_GetUnitBuff(\"boss1\", 473227) and 2 or 1 -- Maximum Output\
               \
               for i = 1, count do\
                   allstates[i] = {\
                       show = true,\
                       changed = true,\
                       progressType = \"timed\",\
                       duration = aura_env.duration,\
                       expirationTime = GetTime() + aura_env.duration,\
                       autoHide = true\
                   }\
               end\
               \
               return true\
           elseif event == \"UNIT_SPELLCAST_SUCCEEDED\" then\
               local _, castGUID, spellID = ...\
               \
               if not castGUID then return end\
               \
               if spellID == 464399 then -- Electromagnetic Sorting\
                   local id = aura_env.id\
                   \
                   C_Timer.After(4, function() WeakAuras.ScanEvents(\"LIQUID_CUSTOM_EVENT\", id) end)\
               end\
           elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\
               local _, subEvent, _, _, _, _, _, destGUID, _, _, _, spellID = ...\
               \
               if subEvent == \"SPELL_DAMAGE\" and spellID == 465747 then -- Muffled Doomsplosion\
                   aura_env.muffledDoomsplosionCounts[destGUID] = (aura_env.muffledDoomsplosionCounts[destGUID] or 0) + 1\
                   \
                   local state = allstates[aura_env.muffledDoomsplosionCounts[destGUID]]\
                   \
                   if state then\
                       state.show = false\
                       state.changed = true\
                       \
                       return true\
                   end\
               end\
